			let response = await this.getDataSrvc(reqData);
			let isValidReq = false;
			if (response != null && response != undefined && typeof response == 'object') {
				isValidReq = true;
			}
			if (!isValidReq) {
				throw new Error('Request creation failed due to data not found');
			}
			// 	let query = `INSERT INTO SROUSER.PUBLIC_CC_STATUS (SR_CODE, DOCT_NO, REG_YEAR, BOOK_NO, USER_ID, STATUS, TIME_STAMP,DEPT_TRANS_ID, REQUESTED_ON, REQUESTED_BY, APP_ID)
			// 	VALUES (${reqData.SR_CODE}, ${reqData.DOCT_NO}, ${reqData.REG_YEAR}, ${reqData.BOOK_NO}, '${reqData.USER_ID}', '${reqData.STATUS}', TO_DATE('${reqData.TIME_STAMP}', 'YYYY-MM-DD'),'${reqData.DEPT_TRANS_ID}',TO_DATE('${reqData.REQUESTED_ON}', 'YYYY-MM-DD'), '${reqData.REQUESTED_BY}', '${reqData.APP_ID}')
			//   `;
			let query = ` INSERT INTO SROUSER.PUBLIC_CC_STATUS (SR_CODE, DOCT_NO, REG_YEAR, BOOK_NO, USER_ID, STATUS,TIME_STAMP,REQUESTED_ON, REQUESTED_BY,APP_ID) VALUES(${reqData.SR_CODE},${reqData.DOCT_NO},${reqData.REG_YEAR}, ${reqData.BOOK_NO}, '${reqData.USER_ID}','${reqData.STATUS}',TO_DATE('${reqData.TIME_STAMP}', 'YYYY-MM-DD'), TO_DATE('${reqData.REQUESTED_ON}', 'YYYY-MM-DD'),'${reqData.REQUESTED_BY}','${reqData.APP_ID}')`;
			let result = await this.dbDao.oDbInsertDocs(query);
			if (result <= 0) {
				throw new Error('Bad Request')
			}
